pragma solidity ^0.6.12;

import "@pancakeswap/pancake-swap-lib/contracts/access/Ownable.sol";
import "./crowdsale/Crowdsale.sol";
import "./crowdsale/RefundVault.sol";
// import "./crowdsale/validation/CappedCrowdsale.sol";
// import "./crowdsale/validation/TimedCrowdsale.sol";
// import "./crowdsale/distribution/RefundableCrowdsale.sol";


// contract MyCrowdsale is Crowdsale, CappedCrowdsale, TimedCrowdsale, RefundableCrowdsale {
contract MyCrowdsale is Crowdsale, Ownable {
    using SafeMath for uint256;

    uint256 public investorMinCap = 100000000000000000; // 0.1BNB
    uint256 public investorHardCap = 50000000000000000000;  // 50BNB

    uint256 public cap;
    // minimum amount of funds to be raised in weis
    uint256 public goal;
    // refund vault used to hold funds while crowdsale is running
    RefundVault public vault;
    uint256 public openingTime;
    uint256 public closingTime;

    bool public isFinalized = false;

    mapping(address => uint256) public contributions;

    event Finalized();

    /**
     * @dev Reverts if not in crowdsale time range.
     */
    modifier onlyWhileOpen {
        // solium-disable-next-line security/no-block-members
        require(block.timestamp >= openingTime && block.timestamp <= closingTime);
        _;
    }

    /**
     * @dev Constructor, creates RefundVault.
     * @param _goal Funding goal
     */
    constructor(
        uint256 _rate,            // rate, in Sokubits   12000 for $0.05 token price
        address payable _wallet,  // wallet to send BNB
        BEP20 _token,            // the token
        uint256 _goal,           // the minimum goal, in wei   50e18 for $30,000
        uint256 _cap,             // // total cap, in wei     833.3333e18 for $500,000
        uint256 _openingTime,
        uint256 _closingTime
    )
        Crowdsale(_rate, _wallet, _token)
        // CappedCrowdsale(cap)
        // RefundableCrowdsale(goal)
        // TimedCrowdsale(openingTime, closingTime)
        public
    {
        // nice! this crowdsale will, if it doesn't hit `goal`, allow everyone to get their money back
        // by calling claimRefund(...)
        cap = _cap;

        require(_goal > 0);
        vault = new RefundVault(wallet);
        goal = _goal;

        require(_openingTime >= block.timestamp);
        require(_closingTime >= _openingTime);

        openingTime = _openingTime;
        closingTime = _closingTime;
    }

    /**
     * @dev Checks whether the cap has been reached.
     * @return Whether the cap was reached
     */
    function capReached() public view returns (bool) {
        return weiRaised >= cap;
    }

    /**
     * @dev Checks the amount of tokens left in the allowance.
     * @return Amount of tokens left in the allowance
     */
    function remainingTokens() public view returns (uint256) {
        return token.balanceOf(address(this));
    }

    /**
     * @dev Checks whether the period in which the crowdsale is open has already elapsed.
     * @return Whether crowdsale period has elapsed
     */
    function hasClosed() public view returns (bool) {
        // solium-disable-next-line security/no-block-members
        return block.timestamp > closingTime;
    }

    /**
     * @dev Investors can claim refunds here if crowdsale is unsuccessful
     */
    function claimRefund() public {
        require(isFinalized);
        require(!goalReached());

        vault.refund(msg.sender);
    }

    /**
     * @dev Checks whether funding goal was reached.
     * @return Whether funding goal was reached
     */
    function goalReached() public view returns (bool) {
        return weiRaised >= goal;
    }

    /**
     * @dev Must be called after crowdsale ends, to do some extra finalization
     * work. Calls the contract's finalization function.
     */
    function finalize() onlyOwner public {
        require(!isFinalized);
        require(hasClosed());

        finalization();
        emit Finalized();

        isFinalized = true;
    }

    /**
     * @dev Can be overridden to add finalization logic. The overriding function
     * should call super.finalization() to ensure the chain of finalization is
     * executed entirely.
     */
    function finalization() internal {
        if (goalReached()) {
            vault.close();
        } else {
            vault.enableRefunds();
        }
    }

    /**
     * @dev Extend parent behavior requiring purchase to respect the funding cap.
     * @param _beneficiary Token purchaser
     * @param _weiAmount Amount of wei contributed
     */
    function _preValidatePurchase(
        address _beneficiary,
        uint256 _weiAmount
    )
        internal
        override
        onlyWhileOpen
    {
        super._preValidatePurchase(_beneficiary, _weiAmount);
        require(weiRaised.add(_weiAmount) <= cap);

        uint256 _existingContribution = contributions[_beneficiary];

        uint256 _newContribution = _existingContribution.add(_weiAmount);
        require(_newContribution >= investorMinCap && _newContribution <= investorHardCap);
        contributions[_beneficiary] = _newContribution;
    }

    /**
     * @dev Overrides Crowdsale fund forwarding, sending funds to vault.
     */
    function _forwardFunds() override internal {
        vault.deposit.value(msg.value)(msg.sender);
    }
}

